import React from 'react';

const Hero = () => {
  return (
    <section id="home" className="hero">
      <div className="container">
        <h1>Студія Розробки</h1>
        <p>
          Професійна розробка веб-сайтів, додатків та дизайну. 
          Ми створюємо сучасні, функціональні та красиві рішення для вашого бізнесу.
        </p>
      </div>
    </section>
  );
};

export default Hero;
